id: alspacdcs:wgs_hiseq_g1_2016-08-18
name: Whole genome sequencing - G1 release version 2016-08-18
description: >-
  Whole genome sequencing for G1 individuals, part of the UK10K
  dataset.

  UK10K_COHORT Release 2012-06-02 : v2
  ====================================

  Description
  ===========

  This release comprises phased genotype calls for 3781 UK10K COHORT
  samples from the following two studies:

  1927	UK10K_COHORT_ALSPAC
  1854	UK10K_COHORT_TWINSUK

  Calling and filtering are described in the README for v1.

  Sites which passed filters (see README for v1) were brought forward to 
  genotype refinement. Samples were dropped after calling and before 
  genotype refinement for reasons described below.

  UK10K_COHORT_TWINSUK
  64 samples removed
  - 7 no GWAS data
  - 1 excessive het rate
  - 55 discordance > 3%
  - 1 coverage < 4x

  UK10K_COHORT_ALSPAC
  48 samples removed
  - 1 excessive het rate
  - 36 discordance > 3%
  - 11 coverage < 4x


  Genotype refinement
  -------------------

  The missing and low confidence genotypes were refined with BEAGLE 4, rev909 in
  chunks of 3,000 sites plus 1,000 sites in buffer regions. Multiallelic sites
  were included in the imputation.


  Further Sample exclusion
  ------------------------

  Further samples were removed after genotype refinement based on the following
  criteria:

  UK10K_COHORT_TWINSUK
  16 samples removed
  - 13 contamination
  - 12 NRD > 5%
  - 3 failed sex check

  UK10K_COHORT_ALSPAC
  1 sample removed
  - 1 contamination
  - 1 NRD > 5%

  For downstream analysis a further 177 samples may be excluded due to non-European 
  ancestry, or relatedness. A list of these samples is provided with the release.


  Annotations
  -----------

  The calls were annotated using vcf-annotate and include dbSNP 137 rsIDs. Sites where 
  different alternate allele of the same type (SNP vs indel) were found in the UK10K data
  have dbSNPmismatch flag in the INFO column.

  The 1000Genomes frequencies are taken from the final 1000 Genomes Phase 1 
  integrated (v3) callset available here:

  ftp://ftp.1000genomes.ebi.ac.uk//vol1/ftp/phase1/analysis_results/integrated_call_sets

  The files used for these annotations can be found on this sftp site

  /uk10k/ref/annots-rsIDs-dbSNPv137.2012-09-13.tab.gz
  /uk10k/ref/annots-rsIDs-AFs.2012-07-19.tab.gz

  on this sftp site.


  Functional Annotations
  ----------------------

  Variant consequence annotations are called using the Ensembl Variant Effect
  Predictor (http://www.ensembl.org/info/docs/variation/vep/index.html), v2.6
  against Ensembl 68.  This provides coding consequence predictions and SIFT,
  PolyPhen and Condel annotations.  Ensembl also provides GERP conservation
  scores. Grantham matrix values come from a simple lookup.

  The consequences are in the format:

  CSQ=ENSTid:Genename:consequence_string[:CDS_coord:Peptide_coord:AA>AA:Functional_annot,value]+ENSTid2:Genename:consequence_string2:...[+gerpScore]

  i.e. consequences are separated by '+', with each consequence containing ':'
  separated fields.  Functional annotations (PolyPhen, etc) are given as
  name,value.

  Files
  ======

  The release is split by chromosome. Each chromosome has a bgzipped VCF file
  (e.g. 21.beagle.anno.csq.20130126.vcf.gz) containing the phased genotype 
  information and a corresponding VCF of the sites only 
  (21.beagle.anno.csq.20130126.sites.vcf.gz). Each VCF has been indexed 
   using tabix, with the index file having the .tbi extension 
  (21.beagle.anno.csq.20130116.vcf.gz.tbi). There is also a stats file for 
  each genotype VCF (21.beagle.anno.csq.20130116.vcf.gz.vchk) created using 
  vcfcheck (see https://github.com/samtools/htslib).

    *.beagle.anno.csq.20130126.vcf.gz, *.beagle.anno.csq.20130126.vcf.gz.tbi, *.beagle.anno.csq.20130126.vcf.gz.vchk
    *.beagle.anno.csq.20130126.sites.vcf.gz, *.beagle.anno.csq.20130126.vcf.gz.tbi

   Based on non-European ancestry and relatedness 177 of the samples in this 
   release should be excluded from certain downstream analysis. These samples 
   are listed in this file:
   samples_for_exclusion.txt

    Information files.

    md5s.txt : md5 checksum of data files
    README   : this file


  
